import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap'

const Header = () => {
    return (
        <>
            <Navbar>
                <LinkContainer to="/">
                    <Navbar.Brand>
                        Gefeasoft Kids Games
                    </Navbar.Brand>
                </LinkContainer>
            </Navbar>
        </>
    )
}

export default Header;
